import React from "react";
import Textarea from "./components/Textarea/Textarea";
import Dropdown from "./components/Dropdown/Dropdown";
import Button from "./components/Button";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <Textarea />
      <Dropdown />
      <Link to="/shop">
        <h6>Categories</h6>
      </Link>
      <Button />
    </div>
  );
}

export default Home;
